export default function Dashboard() {
  return (
    <div style={{ padding: "20px", fontFamily: "Arial", maxWidth: "800px", margin: "0 auto" }}>
      <h1 style={{ textAlign: "center", marginBottom: "30px" }}>Dashboard</h1>

      <section style={{ marginBottom: "40px", padding: "20px", border: "1px solid #ccc", borderRadius: "10px" }}>
        <p>Welcome! Here you can:</p>
        <ul>
          <li>Complete or update your profile</li>
          <li>Post new jobs</li>
          <li>View job listings and filter them</li>
        </ul>
      </section>

      {/* Future: You can include forms for profile/job posting here */}
    </div>
  );
}
